import React from 'react';
import s from './FooterBlock.module.css';


const FooterBlock = () => {

    const items = ['Про проєкт', 'Допомога', 'Туристичні напрямки', 'Реєстрація гідів', 'Реєстрація компаній'];
    
    return (
        <div>
            <div className={s.container}>

                    <ul>
                        { items.map( (item, index) => <li key = {index}><a>{item}</a></li> )}
                    </ul>

            </div>
        </div>
    );
}

export default FooterBlock;
